    str = valueResponse.remainingSource;
    
    this.tokens.push(this.tokEnd(tok));
    
    for(i = 0; i < str.length; i++){
      if(!this.whitespaceRe.test(str[i])) {
        break;
      }
      if(str[i] === '\n'){
        this.incrementLine(1);
      } else {
        this.incrementColumn(1);
      }
    }
    
    if(str[i] === ','){
      this.incrementColumn(1);
      i++;
    }
    
